--INSERT INTO UI_FIELD_RULES (REQUEST_TYPE_ID, REQUEST_STAGE_ID, FIELD_ID, IS_VISIBLE, IS_EDITABLE, IS_MANDATORY)
--SELECT RTRS.REQUEST_TYPE_ID , RTRS.REQUEST_STAGE_ID, FL.ID, TRUE IS_VISIBLE, TRUE IS_EDITABLE, FALSE IS_MANDATORY FROM REQUEST_TYPE_REQUEST_STAGE_RULES RTRS
--JOIN UI_FIELD_LIST FL
--ORDER BY RTRS.REQUEST_TYPE_ID, RTRS.REQUEST_STAGE_ID, FL.ID;

SELECT RTRS.REQUEST_TYPE_ID , RTRS.REQUEST_STAGE_ID, FL.ID, true IS_VISIBLE, false IS_EDITABLE, false IS_MANDATORY  FROM
    ( SELECT * FROM REQUEST_TYPE_REQUEST_STAGE_RULES RTRS
     UNION (SELECT ROWNUM+50 ID, 10 STAGE_ORDER, ST.ID REQUEST_STAGE_ID,  RT.ID REQUEST_TYPE_ID FROM LOOKUP_REQUEST_TYPE RT
     JOIN LOOKUP_STAGE_TYPE ST WHERE STAGE = 'Closed')) RTRS
JOIN UI_FIELD_LIST FL
ORDER BY RTRS.REQUEST_TYPE_ID, RTRS.REQUEST_STAGE_ID, FL.ID;

-- DISABLE ALL REUEST DETAILS BUTTONS
UPDATE UI_FIELD_RULES FR SET FR.IS_VISIBLE =FALSE
WHERE  FIELD_ID IN (135, 136, 145, 146, 209);

--CREATE CUSTOMER, PERIODIC REVIEW FIRST STAGE
UPDATE UI_FIELD_RULES FR SET FR.IS_EDITABLE = TRUE
WHERE  REQUEST_TYPE_ID IN (11000, 11005)
AND REQUEST_STAGE_ID IN (19000)
AND FIELD_ID IN (105, 106, 107, 108, 109, 110, 111, 112, 113, 114, 115, 116, 117, 118, 119, 120, 121, 122, 123, 124, 125, 126, 127, 128, 129, 130, 131, 132, 133, 134, 142, 143, 144, 220);
