UPDATE UI_FIELD_RULES FR SET FR.IS_VISIBLE =false
WHERE  FIELD_ID IN (135, 136, 145, 146, 209);
--ENABLE SAVE, SUBMIT BUTTONS
UPDATE UI_FIELD_RULES FR SET FR.IS_VISIBLE = TRUE, FR.IS_EDITABLE = TRUE
WHERE FR.FIELD_ID IN (145, 209)
AND (
	(REQUEST_TYPE_ID = 11000 AND REQUEST_STAGE_ID IN (19000, 19001, 19002, 19003, 19004))
OR 	(REQUEST_TYPE_ID = 11001 AND REQUEST_STAGE_ID IN (19007, 19003, 19004))
