OR 	(REQUEST_TYPE_ID = 11005 AND REQUEST_STAGE_ID IN (19000, 19001, 19002, 19003, 19004))
OR 	(REQUEST_TYPE_ID = 11006 AND REQUEST_STAGE_ID IN (19000, 19003, 19004))
);
